options.transformation:
return data.map((row) => ({
  ...row,
  formatted_created_at: moment(parseInt(row.created_at)).format(
    "DD-MM-YYYY hh:mmA"
  ),
  formatted_updated_at: moment(parseInt(row.updated_at)).format(
    "DD-MM-YYYY hh:mmA"
  ),
  formatted_price: parseFloat(row.price).toFixed(2),
}));

return data.filter(
  (row) =>
    parseFloat(row.price) >= components.numberinput1.value &&
    parseFloat(row.price) <= components.numberinput2.value
);
